import React, {Component} from 'react';
import axios from 'axios';
import './App.css';
import key from './key';
import SearchBar from './SearchBar/SearchBar';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { 
      videoSearchResults: [],
      allComments: [],
      replies: []
     }
  }

  componentDidMount(){

  }

  getSearchResults = async (searchInput) => {
    let response = await axios.get(`https://youtube.googleapis.com/youtube/v3/search?q=${searchInput}&key=${KEY}&maxResults=10&part=snippet`);
    this.setState({
      videoSearchResults: response.data.items
    })
  }



  render() { 
    return ( 
      <div>
        <SearchBar handleSearchSubmit={this.getSearchresults}/>
      </div>
     );
  }
}

export default App;
